import React, { useEffect } from 'react';

function Delete() {
  useEffect(() => {
    const handleCallback = async () => {
      try {
        const response = await fetch('http://localhost:80/callback');
        if (response.ok) {
          // La solicitud fue exitosa, puedes realizar acciones adicionales aquí si es necesario
          console.log('La función callback se ejecutó correctamente.');
        } else {
          // La solicitud falló
          console.error('Error al llamar a la función callback:', response.status, response.statusText);
        }
      } catch (error) {
        // Error al realizar la solicitud
        console.error('Error al llamar a la función callback:', error);
      }
    };

    handleCallback();
  }, []);

  return null; 
}

export default Delete;
